import React from "react";
import "./style.css";

const Video = props => {
    return (

        <div className="container-video">

            <div className="recipes">
                <h2>Featured Weekly Video</h2>
                <img src="./images/mish-mash-icon-yellow-new.png" width="50" alt="Icon" id="recipeIcon" />
                <br></br>
            </div>


        </div>

    );
};

export default Video;
